package net.huangang.naming;

public class Student {
	
	private String name;
    private String number;
    
    public Student(String name, String number) {
		// TODO Auto-generated constructor stub
    	this.name = name;
    	this.number = number;
    	
	}

    public String getName() {
    	
        return name;
    }
    
    public String getNumber() {
    	
        return number;
    }
}
